import React from "react";

function TitleH1(props) {
    return (
        <div className="mb'-4">
            <h1 className="display-2 text-3d text-center" >{props.title}</h1>
            <h4>{props.subtitle}</h4>
        </div>
    );
}

export default TitleH1;
